#include <iostream>
#include <string>
using namespace std;
string remove_dup(string s){
        int i = 0;
        while(i<s.size()-1)
        {
            if (s.size() == 1 || s.size() == 0)
            break;
            if(s[i] == s[i+1])
            { 
                s.erase(s.begin()+i, s.begin()+i+2);
                i = 0;
                continue;
                }
            else
                i+=1;
        }
        return s;
        
    }
int main()
{
    string s;
    string x = "";

    cout<<remove_dup(x)<<endl;

}